import "./App.css";

function App() {
  const user = (
    <div>
      <h1>Ahmed</h1>
      <h2>Abdulrahman</h2>
      <h2>ahmedabdi03@hotmail.com</h2>
      <h3>20</h3>
    </div>
  );

  return <div className="App">
    {user}
    </div>;
}
export default App;
